import React from "react";
import ".";

function Access() {
  return (
    <div className="access-container">
      <div className="access-number">318278</div>
      <button className="access-button">ACCESS FILE</button>
      <div className="file-list">
        <div className="file-item">
          <input type="checkbox" />
          <div className="file-info">Karina.png</div>
          <div className="file-info">PNG</div>
          <div className="file-info">12/12/2023</div>
          <div className="file-info">3.4 MB</div>
        </div>
        {/* Add other file items here following the same pattern */}
      </div>
      <button className="download-button">DOWNLOAD</button>
    </div>
  );
}

export default Access;
